  //   }

  //   if (!authenticated) {
  //     return <Navigate to="/" />;
  //   }
  //   return children;
  // };

  return (
    <Router>
      <Authprovider>
        <Routes>
          <Route exact path="/" element={<Login />} />
          <Route exact path="/homepage" element={<HomePage />} />
          <Route
            path="/newreservationpage"
            element={
              <Private>
                <NewReservationPage />
              </Private>
            }
          />
          <Route
            path="/myreservations"
            element={
              <Private>
                <Myreservations />
              </Private>
            }
          />
          <Route
            path="/admin"
            element={
              <Private>
                <AdminPage />
              </Private>
            }
          />
        </Routes>
      </Authprovider>
    </Router>
  );
};

export default AppRoutes;
